function getInfoBoxValue()
{
    var xmlhttp;
    if (window.XMLHttpRequest) {// code for IE7+, Firefox, Chrome, Opera, Safari
        xmlhttp = new XMLHttpRequest();
    }
    else {// code for IE6, IE5
        xmlhttp = new ActiveXObject("Microsoft.XMLHTTP");
    }
    xmlhttp.onreadystatechange = function () {
        if (xmlhttp.readyState == 4 && xmlhttp.status == 200) {
            var regionFeatureValue = xmlhttp.responseText.split(' ');
            
            initializeInfoBox(regionFeatureValue);


            Microsoft.Maps.loadModule('Microsoft.Maps.Themes.BingTheme', { callback: themesModuleLoaded });
         

        }
    }
    // xmlhttp.open("GET", "getFeature.aspx?method=roadFeature", true);
    xmlhttp.open("GET", "getRoadFeature.aspx", true);
    xmlhttp.send();
}




