function getRegionLabelByID(regionID, mode)
{
    if (regionLabel[regionID] == undefined) {
        if (mode == 1) {
            return "Region " + regionID;
        }
        else
        {
            return "";
        }
    }
    else {
        if (mode == 1)
        {
            if (regionLabel[regionID].length > 30)
                return regionLabel[regionID].substring(0, 29) + "...";
            else
                return regionLabel[regionID];
        }
        return regionLabel[regionID];
    }
}

