function getColorbyValue(value) {
    var thisColor = new Array(4);
    value = Math.round(value * 63) + 1;
    thisColor[1] = cm1[value];
    thisColor[2] = cm2[value];
    thisColor[3] = cm3[value];
        
    return thisColor;
}

function latIndex(i) {
    return (maxLat - minLat) / 2400 * i + minLat;
}

function longIndex(i) {
    return (maxLong - minLong) / 2400 * i + minLong;
}





