function drawCanvas(timeValue, hour)
{
    hour = parseInt(hour);

    var totalWidth = 356;
    var totalHeight = 100;

    var can = document.getElementById("timeCanvas");
    can.height = totalHeight;
    clearCanvas("timeCanvas", totalWidth, totalHeight);
   
    var maxTimeValue = getScaleOfAllRegion();

   /* var maxTimeValue = 0;

    for (var t = 1; t <= 24; t++)
    {
        if (parseFloat( timeValue[t]) > maxTimeValue)
        {
            maxTimeValue = timeValue[t];
        }
    }*/

    var hourWidth = totalWidth / 24;
    for (var t = 1; t <= hour; t++) {
        var c = document.getElementById("timeCanvas");
        var ctx = c.getContext("2d");
        ctx.beginPath();
        ctx.rect(parseInt((t - 1) * hourWidth) + 2, totalHeight - parseInt(timeValue[t] / maxTimeValue * totalHeight), parseInt(hourWidth) - 4, parseInt(timeValue[t] / maxTimeValue * totalHeight));
        // ctx.rect(20, 20, 20, 20);
        
        ctx.fillStyle = "#428BCA";

        ctx.fill();

        ctx.closePath();
       
    }

    ctx.beginPath();
    ctx.font = "12pt Calibri";
    ctx.fillStyle = 'black';
    ctx.fillText('0:00 ~ ' + (hour - 1) + ':00', totalWidth / 2 - 36, 15);
    ctx.closePath();

}

