function drawRegionCanvas(categoryValue)
{
    var totalWidth = 356;
    var totalHeight = 100;

    clearCanvas("regionCanvas", totalWidth, totalHeight);

    var hourWidth = totalWidth / 24;
    for (var t = 1; t <= 24; t++) {
        var remainHeight = totalHeight;
        for (var c = 5; c >= 1; c--) {
            var thisValue = categoryValue[(c - 1) * 25 + t + 1];
            var can = document.getElementById("regionCanvas");
            var ctx = can.getContext("2d");
            ctx.beginPath();
            ctx.rect(parseInt((t - 1) * hourWidth) + 2, remainHeight - parseInt(thisValue * totalHeight), parseInt(hourWidth) - 4, parseInt(thisValue * totalHeight));
            // ctx.rect(20, 20, 20, 20);
            remainHeight = remainHeight - parseInt(thisValue * totalHeight);
            if (c == 5) {
                ctx.fillStyle = "#25E82C";
            }
            else if (c == 4)
            {
                ctx.fillStyle = "grey";
            }
            else if (c == 3)
            {
                ctx.fillStyle = "orange";
            }
            else if (c == 2)
            {
                ctx.fillStyle = "purple";
            }
            else if (c == 1)
            {
                ctx.fillStyle = "red";
            }

            ctx.fill();

            ctx.closePath();
        }

    }

    document.getElementById("categoryLabel1").innerHTML = getCategoryByID(categoryValue[1]);
    document.getElementById("categoryLabel2").innerHTML = "&nbsp&nbsp" + getCategoryByID(categoryValue[26]);
    document.getElementById("categoryLabel3").innerHTML = "&nbsp&nbsp" + getCategoryByID(categoryValue[51]);
    document.getElementById("categoryLabel4").innerHTML = "&nbsp&nbsp" + getCategoryByID(categoryValue[76]);
    document.getElementById("categoryLabel5").innerHTML = "&nbsp&nbsp" + getCategoryByID(categoryValue[101]);
}

