function drawOverallTimeCanvas(overallTimeValue) {

    var totalWidth = 356;
    var totalHeight = 100;


    var can = document.getElementById("timeCanvas");
    can.height = totalHeight;
    clearCanvas("timeCanvas", totalWidth, totalHeight);
    
    
    
    var startPoint = 0;
    var thisColor = new Array(6);
    thisColor[1] = "red";
    thisColor[2] = "purple";
    thisColor[3] = "orange";
    thisColor[4] = "grey";
    thisColor[5] = "#25E82C";
    thisColor[6] = "blue";
    thisColor[7] = "magenta";
    thisColor[8] = "black";
    var sumOverallTimeValue = 0;
    for (var c = 1; c <= 8; c++) {
        sumOverallTimeValue += parseFloat(overallTimeValue[c * 2]);
    }
    for (var c = 1; c <= 8; c++) {
        var can = document.getElementById("timeCanvas");
        var ctx = can.getContext("2d");
        ctx.fillStyle = thisColor[c] ;
        ctx.beginPath();
        ctx.moveTo(totalWidth / 2 + 90, totalHeight / 2);
        ctx.arc(totalWidth / 2 + 90, totalHeight / 2, totalHeight / 2 - 2, startPoint, startPoint + Math.PI * 2 * parseFloat(overallTimeValue[c * 2] / sumOverallTimeValue), false);
        ctx.fill();
        startPoint = startPoint + Math.PI * 2 * parseFloat(overallTimeValue[c * 2] / sumOverallTimeValue);
        ctx.closePath();

        ctx.beginPath();
        ctx.font = "10pt Calibri";
        ctx.fillStyle = thisColor[c];
        ctx.fillText(getCategoryByID(parseInt(overallTimeValue[c * 2 - 1])) + ':', 10, c * 11.5 + 2);
        ctx.fillText(parseInt(overallTimeValue[c * 2] * 1000) / 10, 140, c * 11.5 + 2);
        ctx.closePath();
    }
    var ctx = can.getContext("2d");
    ctx.beginPath();
    ctx.font = "10.5pt Calibri";
    ctx.fillStyle = thisColor[1];
    ctx.fillText('(%)', 168, 1 * 11.5 + 2);
    ctx.closePath();

}

function getHexColorbyValue(value) {
    var thisColor = new Array(4);
    value = Math.round(value * 63) + 1;
    thisColor[1] = cm1[value].toString(16);
    thisColor[2] = cm2[value].toString(16);
    thisColor[3] = cm3[value].toString(16);
    if (thisColor[1].length < 2){
        thisColor[1] = "0" + thisColor[1]
    }
    if (thisColor[2].length < 2) {
        thisColor[2] = "0" + thisColor[2]
    }
    if (thisColor[3].length < 2) {
        thisColor[3] = "0" + thisColor[3]
    }
    return "#" + thisColor[1] + thisColor[2] + thisColor[3];
}

function addToCompare(regionID)
{
    if (compareListNum == 3) {
        alert('Only support three regions.');
    }
    else {
        var inList = 0;
        for (var i = 1; i <= compareListNum; i++) {
            if (compareList[i] == regionID) {
                inList = 1;
            }
        }
        if (inList == 1)
        {
            alert('This region is already in the list.')
        }
        else
        {
            compareListNum++;
            compareList[compareListNum] = regionID;
        }
    }
    updateCompareList();
}

function deleteFromCompare(regionID)
{
    var thisDelete = 0;
    for (var i = 1; i <= compareListNum; i++) {
        if (compareList[i] == regionID)
        {
            thisDelete = i;
        }
    }
    for (var i = thisDelete; i <= compareListNum - 1; i++) {
        compareList[i] = compareList[i + 1];
    }
    compareListNum--;
    updateCompareList();
}
function updateCompareList()
{
    if (compareListNum == 0) {
        document.getElementById("compareList").style.display = "none";
    }
    else {
        document.getElementById("compareList").style.display = "";
        var thisHTML = "<table class=\"table\"><th>Region List</th>";
        for (var i = 1; i <= compareListNum; i++)
        {
            thisHTML += "<tr><td style=\"width:170px;\">Region " + compareList[i] + "</td><td><a onclick=\"deleteFromCompare(" + compareList[i] + ")\">Delete</a></td></tr>"
        }
        thisHTML += "</table>";
        thisHTML += "<center><button type=\"button\" class=\"btn btn-primary\" style=\"margin-top:-10px; margin-bottom:10px; height:24px; line-height:10px;\" data-toggle=\"modal\" data-target=\"#myModal\" onclick=\"getCompareBox()\">Compare</button></center>"
        document.getElementById("compareList").innerHTML = thisHTML;
    }
}

