function drawColorBarCanvas()
{
    var totalWidth = 60;
    var totalHeight = 350;
    var colorBarHeight = 300;

    var can = document.getElementById("colorBarCanvas");
    clearCanvas("colorBarCanvas", totalWidth, totalHeight);
    var thisScale = getScale();
   
    for (var i = colorBarHeight; i >= 1; i--)
    {
        var thisColor = getHexColorbyValue(i / colorBarHeight);
        var can = document.getElementById("colorBarCanvas");
        var ctx = can.getContext("2d");
        
        ctx.beginPath();
        ctx.strokeStyle = thisColor;
        
        ctx.moveTo(0, colorBarHeight - i + 20);
        ctx.lineTo(20, colorBarHeight - i + 20);
        ctx.stroke();
        ctx.closePath();
        if (i % 60 == 0)
        {
            ctx.beginPath();
            ctx.font = "12pt Calibri";
            ctx.fillStyle = 'black';
            ctx.fillText(Math.round(i / colorBarHeight * thisScale), 22, colorBarHeight - i + 25);
            ctx.closePath();
        }
    }
    ctx.beginPath();
    ctx.font = "12pt Calibri";
    ctx.fillStyle = 'black';
    ctx.fillText(0, 22, colorBarHeight + 25);
    ctx.closePath();
}